/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `usuarios` (
  `idUsuario` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(50) NOT NULL COMMENT 'Nombre del usuario',
  `apellidos` varchar(50) NOT NULL COMMENT 'Apellidos del usuario',
  `genero` enum('hombre','mujer','otro') NOT NULL COMMENT 'Género del usuario',
  `fechaNacimiento` date NOT NULL COMMENT 'Fecha de nacimiento del usuario',
  `email` varchar(100) NOT NULL COMMENT 'Email único del usuario',
  `contraseña` varchar(255) NOT NULL COMMENT 'Contraseña del usuario, almacenada de forma segura',
  `avatar` blob DEFAULT NULL COMMENT 'Imagen de perfil del usuario en formato BLOB',
  `fechaDeRegistro` datetime DEFAULT current_timestamp() COMMENT 'Fecha y hora de registro del usuario',
  `fechaDeUltimoCambio` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Fecha y hora del último cambio en la información del usuario',
  `rol` varchar(20) NOT NULL,
  `estado` enum('activo','baja') NOT NULL DEFAULT 'activo' COMMENT 'Estado del usuario (activo o dado de baja)',
  `intentos` int(11) DEFAULT 0,
  PRIMARY KEY (`idUsuario`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `email_2` (`email`),
  CONSTRAINT `chk_rol` CHECK (`rol` in ('docente','alumno','admin'))
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
